import './container.css';

const SearchBar = () => {
  return (
    <div className='searchbar'> 
   <form className='form' action="">
    <input type='text'  placeholder='Serch here ..'/>
    <button><i class='bx bx-search'></i></button>
   </form>
      <div className='otherusers-box'>
        <OtherusersContainer/>
      </div>
    </div>
  )
}

export default SearchBar;
